import React, { Component } from "react";
import ReactDOM from "react-dom";
import "./css/main.css";
import DemoSider2 from "./demo/demoSider2";
import DemoAffix from "./demo/demoAffix";

class App extends Component {
  render() {
    return (
      <div className="App">
        <DemoAffix />
      </div>
    );
  }
}

export default App;

ReactDOM.render(<App />, document.getElementById("root"));
